import {PuffLoader} from "react-spinners";

function Loader(props) {

	return (
      <div style={{width: "100%",  height: "70vh", background : "white", border : "10px solid", display: "flex", justifyContent : "center", alignItems : "center", marginTop : "5%"}}>
	      <PuffLoader
	       loading={true}
	       color={"#B0DFE5"}
	      />
      </div>
	);
}

export default Loader
